function App() {
  return (
    <div className="app">
      <Router basename="/get-started">
        {/* <Header /> */}
        <Switch>
          <Route path="/result" component={Result}></Route>
          <Route path="/" component={Test}></Route>
          {/* <Route path="/" component={Menu}></Route> */}
        </Switch>
      </Router>
    </div>
  );
}

export default App;
